import React, { Component } from 'react';
import Product from './Product';

class ProductList extends Component {
  render() {
    
    const { products } =  this.props;

    return (
      <div className="products">
        {products.map((product) => (
          <Product
            key={product.id}
            product={product}
          />
        ))}
      </div>
    )
  }
}

export default ProductList;
